import { Component, OnInit } from '@angular/core';
import { DomSanitizer } from '@angular/platform-browser';
import {AccountService} from '../_services/account.service'
import { User } from '../_models/user';
import { SignalRService } from '../_services/signal-r.service';
import { FtpService } from '../_services/ftp.service';
import { IFtpResult } from '../ftp/ftp.result';

@Component({ templateUrl: 'home.component.html' })

export class HomeComponent implements OnInit{
    user: User;
    tool: string;
    products: IFtpResult[] = [];
    errorMessage: string;
    image1: string;
    fileStoreActive: boolean;

    sensor1: string;
    sensor2: string;
    pirsensorstair: string;

    constructor(private accountService: AccountService, public signalRService: SignalRService, public sanitizer:DomSanitizer, private ftpService:FtpService ) 
    {
        this.user = this.accountService.userValue;
    }

    ngOnInit() {
        this.signalRService.startConnection();
        this.signalRService.addTransferChartDataListener();   
        this.tool = "";
        this.fileStoreActive = true;
        this.sensor1 = "off";
        this.sensor2 = "off";
        this.pirsensorstair = "off";

        this.signalRService.getValue().subscribe((value) => {

          if(value["source"] == "sensor1")
          {
            var jsonObj = JSON.parse(value["payload"]);
            this.sensor1 = jsonObj["status"];
          }
          else if(value["source"] == "sensor2")
          {
            var jsonObj = JSON.parse(value["payload"]);
            this.sensor2 = jsonObj["status"];
          }
          else if(value["source"] == "pirstair")
          {
            this.pirsensorstair = value["payload"];
         
          }

        });
      }

      public sendMsg(data: string) 
      {
        console.log(event);
        this.signalRService.broadcastChartData(data);        
      }

      public getAllRecords()
      {
        this.tool = "";
        this.ftpService.getProducts().subscribe({
          next: products => {
            this.products = products;

            ///generate html
            var i = 0;
            this.products.forEach( (element) => {
              this.tool += '<a download="shit.jpg" href=' + element.imageUrl + '>Download' + i + '</a>'
              i++;
          });

          },
          error: err => this.errorMessage = err
        });
      }


      setSaving(element, mybool)
      {

        //fetch current recording state from server
        this.fileStoreActive = !this.fileStoreActive;
        if(!this.fileStoreActive)
        {
          element.textContent = "Recording Mode = Off";
        }
        else{
          element.textContent = "Recording Mode = On";
        }

        //element.disabled = true;
      }
    
         //Call this method in the image source, it will sanitize it.
   transform()
   {
     //return this.sanitizer.bypassSecurityTrustResourceUrl(this.base64Image2);
     if(this.signalRService.picture1 == undefined)
     {
       return this.sanitizer.bypassSecurityTrustResourceUrl(this.base64Image2); 
     }
     return this.sanitizer.bypassSecurityTrustResourceUrl('data:image/jpg;base64, ' + this.signalRService.picture1);
   }
   transform2()
   {
    if(this.signalRService.picture2 == undefined)
    {
      return this.sanitizer.bypassSecurityTrustResourceUrl(this.base64Image2); 
    }     
     return this.sanitizer.bypassSecurityTrustResourceUrl('data:image/jpg;base64, ' + this.signalRService.picture2);
   }

   htmlStr2: string = 'data:image/jpg;base64, ' + this.signalRService.picture2;



   base64Image2='data:image/jpg;base64,';
}

